import React from "react"
import fire from "../Fire"
import { BrowserRouter as Router, Link, Route } from "react-router-dom"
import Recommendation from "./Recommendation"
import Books from "./Books"

class Header extends React.Component{

	constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }

    logout() {
        fire.auth().signOut();
    }

    render(){
		return(
			<Router>
				<header>
					<nav class="navbar navbar-inverse">
					  <div class="container-fluid">
					    <div class="navbar-header">
					      <a class="navbar-brand" href="#">Boogle</a>
					    </div>
					    <ul class="nav navbar-nav navbar-right">
					      <li><a href="#"><span class="glyphicon glyphicon-book"></span><Link to="/recommendation"> Recommendations</Link></a></li>
					      <li><a href="#"><span class="glyphicon glyphicon-search"></span><Link to="/books"> Books</Link></a></li>
					      <li><a href="#" onClick={this.logout}><span class="glyphicon glyphicon-log-out"></span> Log Out</a></li>
					    </ul>
					  </div>
					</nav>
				</header>
				<Route exact path="/recommendation" component={ Recommendation }/>
				<Route exact path="/books" component={ Books }/>
			</Router>
		)
	}
}

export default Header
